import React from 'react';
import CollectionCards from '../components/gridBox/gridBox';
import Header from '../components/header';

const Movies = () => {
  return (
    <React.Fragment>
      <Header />
      <CollectionCards />
    </React.Fragment>
  );
};

export default Movies;
